export default () => ({
  name: 'editor-file',

  install(_: Engine, editor: Editor): void {
    editor.loadData = async () => {
        const { parser } = await useXmlParser()
        const { rule } = parser.parse(xml)
        
        return this.parse(rule)
    }
  },

  parse(rule: Rule) {
    const { main_process } = rule

    const taskConfigs: TaskNodeConfig[] = []

    const taskKeys = Object.keys(main_process.flow)

    for(let i = 0; i < taskKeys.length; i++) {
        const key = taskKeys[i]
        const taskList = main_process.flow[key]

        for(let j = 0; j < taskList.length; j++) {
            const taskData = taskList[j]
            const { $ } = taskData
            const { task_id, name } = $
            const [ x, y, _, __, ] = $.shape.split(/\,\s*/)
            taskConfigs.push({
                id: task_id,
                x: parseInt(x),
                y: parseInt(y),
                name,
                icon: ''
            })
        }
    }

    return {
        tasks: taskConfigs
    }
  }
})

export type Rule = {
    $: {
		name: string,
		user: string,
		version: string,
		directory: string,
		seed_value: `${number}`,
		task_count: `${number}`,
		client_version: string,
		server_version: string
    }

    using_member_list: {
        uSystemExpression: {
            $: {
                values: string
            }
        }
    },
    rule_comments: string,
    max_thread_count:{
        $: {
            use_import_exe_list: `${boolean}`,
            count: `${number}`
        }
    },
    max_divide_count: {
        $: {
            count: `${number}`
        }
    },
    db_transaction_mode: {
        $: {
            mode: string
        }
    },
    startable_ignore: {
        $: {
            mode: `${boolean}`
        }
    },
    endable_ignore: {
        $: {
            mode: `${boolean}`
        }
    },
    execute_rulecall_thread: {
        $: {
            mode: `${boolean}`
        }
    },
    execute_rtdread_thread: {
        $: {
            mode: `${boolean}`
        }
    },
    execute_oplread_thread: {
        $: {
            mode: `${boolean}`
        }
    },
    execute_splunkread_thread: {
        $: {
            mode: `${boolean}`
        }
    },
    rule_description: string,
    use_nvl: {
        $: {
            use_integer: `${boolean}`,
            integer: `${number}`,
            use_double: `${boolean}`,
            double: `${number}`
        }
    },
    parameters: {
        $: {
            type: string
        },
        parameter: Array<{
            '#text': string
            $: {
                name: string
                type: string
                default: string
            }
        }>
    },
    global_variable: {
        variable: Array<{
            '#text': string
            $: {
                name: string,
                type: string,
                desc: string,
            }
        }>
    },
    main_process: {
        flow: Record<string, FlowNode[]>
    },
    flow_summary: string,
    comments: {
        comment: {
            $: {
                task_id: string,
                shape: string,
                title: string,
                alignment: string,
                color: `${number}`,
                fontcolor: string,
                shapestyle: string,
                flow_type: string,
                is_rule_overview_title: string,
                is_rule_overview_contents: string,
                font: string,
                linkedtask: string
            }
        }[],
    },
    subrule_manager: string[],
    grouprule_manager: string[],
    histories: {
        synopsis: string[],
        history: {
            '#text': string,
            $: {
                user: string,
                action: string,
                date: string,
                version_info: string,
                comment: string
            }[]

        }[],
    }[],
} 

type NextFlowTask = {
    $: {
        id: string,
        condition: `${number}`
        points: string,
        color: string
    }
}

type FlowNode = {
    $: {
        task_id: string,
        name: string,
        icon_groupid: string,
        icon: string,
        shape: `${number}, ${number}, ${number}, ${number}`,
        active: `${boolean}`,
        break_point: string,
        status: `${boolean}`,
        applydatetime: string,
        executiing_order: `${number}`,
        timeout: string,
        dev_mode: string,
        linkchangedflag: `${boolean}`,
        isinloop: `${boolean}`
    }
    next_flow: {
        task: NextFlowTask[]
    },
}
